create table meta_translation_import
(
    module        varchar(255),
    message_key   varchar(1024),
    language      varchar(255) default 'ru'::character varying,
    message_value varchar(1024)
);

alter table meta_translation_import
    owner to postgres;

  <Box d="flex" alignItems="center">
    <Icon icon={"exclamation-triangle"} />
    <span>{_t("The scheduler service is disabled.")}</span>
  </Box>
</>', 'ru', null);

select (nextval('meta_translation_seq')) as id
  , imp.message_key
  , imp.message_value
  , imp.language
from (select ti.message_key
        , max(ti.message_value) as message_value
        , ti.language
      from meta_translation_import ti
      group by ti.message_key, ti.language) as imp
where not exists(select 1
    from meta_translation te
    where te.message_key = imp.message_key and te.language = imp.language)
;
